import React from 'react'

function TextBox(props){

    const state = {
        text: 'T채m채 teksti on laatikossa!'
    }
    
    return(
        <div className="offset-1">
            <input
                type="text"
                value={state.text}
            />
            <div></div>
            <div>
                <input type='text'/>
            </div>
            <div>
                <button>Vaihda Teksti</button>
            </div>
        </div>
    )
}

export default TextBox
